import React from 'react'
import { Link } from 'react-router-dom';
import Frame from './assets/Frame.svg';
import './Header.css';

const Header = () => {
    return (
        <div>
            <h1>
                <Link to="/" className='logo'>
                    <img src={Frame} alt="" />
                </Link>
            </h1>
        </div>
    )
}

export default Header
